const ScreenShot = ({id, src, alt, caption}) => {
    console.log(id);
    return (
    <div key={`screen-shot_${id}`}>
        <p>screenshot</p>
        <img
            src={src}
            alt={alt}
        />
        <p>{caption}</p>
    </div>
)};

export default ScreenShot;
